import React from 'react';
import { Helmet } from 'react-helmet';

import ImageSlider from '../../../../../Components/ImageSlider/ImageSlider';

const atiyyah = () => {
    const pics = [
        'img/AtiyyahGraff/Atiya.jpg',
        'img/AtiyyahGraff/Atiyya.jpg'
    ];
    return (
        <div id="our-models" className="text-center">
            <Helmet>
                <title>Atiyyah Graff</title>
            </Helmet>
            <h2>
                Our Models
            </h2>
            {/* <ImageSlider images={[ */}
            {
                pics.array.forEach((element) => {
                    <ImageSlider images={element} />  
                })
            }
                            {/* ]}/> */}
    </div>
    )
}

export default atiyyah;
